import React from "react";
import { Routes, Route, BrowserRouter } from "react-router-dom";
import Login from "./components/test/components/login";
import Private from "./components/test/components/private";

function App() {
  return (
    <div>
      <div className="container-md mt-5">
        <BrowserRouter>
        <Routes>
          <Route path="/private" element={<Private />} />
          <Route path="/" element={<Login />} />
        </Routes>
        </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
